function Header() {
	return (
		<header className="header">
			<div className="header-blank"></div>
			<div className="top-banner">
				<img
          alt=""
					src="/buttons/home-icon.svg"
					width="21px"
					height="19.2px"
					color="white"
				/>
			</div>
		</header>
	);
}

export default Header;
